import React from "react";
import { Nav,Link, NavMenu }
	from "./NavbarElements";

const Navbar = () => {
return (
	<>
	<Nav>
		<NavMenu>
		<Link to="/AboutMe" activeStyle>
			About
		</Link>
		<Link to="/Project" activeStyle>
			Project
		</Link>

		<NavLink to="/SubmitForm" activeStyle>
			Submit
		</NavLink>
		</NavMenu>
	</Nav>
	</>
);
};

export default Navbar;
